        depth={depth}
        />
    })

const bookingNodes = bookings.map(booking => {
    return <Booking 
        key={booking._id} 
        booking={booking}
        updateBooking={updateBooking}
        deleteBooking={deleteBooking}
    />
    });



    return(
        <div>
        <Graph data={data}/>
        </div>
    )
}

export default GraphList;
